query Organizations($curser: String) {
  viewer {
    __typename
    organizations(first: 40, after: $curser) {
      __typename
      pageInfo {
        __typename
        endCursor
        hasNextPage
      }
      totalCount
      nodes {
        __typename
        repositories(first: 40) {
          __typename
          totalCount
          nodes {
            __typename
            name
            nameWithOwner
            pullRequests(first: 10, states: OPEN) {
              __typename
              totalCount
              nodes {
                __typename
                id
                url
                title
                author {
                  __typename
                  login
                  avatarUrl(size: 120)
                }
                comments {
                  __typename
                  totalCount
                }
                mergeable
                reviewDecision
                reviewRequests(first: 10) {
                  __typename
                  totalCount
                  nodes {
                    __typename
                    requestedReviewer {
                      __typename
                      ... on User {
                        __typename
                        id
                        login
                        name
                        email
                        avatarUrl
                      }
                    }
                  }
                }
                reviews(first: 20) {
                  __typename
                  totalCount
                  nodes {
                    __typename
                    state
                    createdAt
                    author {
                      __typename
                      login
                      avatarUrl
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  }
}

